import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View,SafeAreaView } from 'react-native';

export default function App() {
  return (
    <SafeAreaView style={{flex:1,backgroundColor:"#0003"}}>
      <StatusBar/>
    <View style={styles.container}>
      <Text style={{color:"white",fontSize:20}}>Open up App.js to start working your app!</Text>
    </View>
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    backgroundColor:"#000",
    flex:0.3,
    alignItems:"center"
  },
});
